"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Vestibular schwannoma (acoustic neuroma) (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/vestibular-schwannoma-acoustic-neuroma-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H27200522\">",
"      <span class=\"h1\">",
"       What is a vestibular schwannoma?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A vestibular schwannoma is a growth on the nerve that goes from the ear to the brain. It can cause hearing loss and balance problems. Another name for a vestibular schwannoma is &ldquo;acoustic neuroma.&rdquo;",
"     </p>",
"     <p>",
"      Vestibular schwannomas are more common in adults than children. They usually happen in just 1 ear, but a few people get them in both ears.",
"     </p>",
"     <p>",
"      Some people have a higher risk of getting a vestibular schwannoma. They include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        People who have a disease called &ldquo;neurofibromatosis type 2&rdquo; or NF2 &ndash; This disease causes growths in different parts of the body. It can run in families. If someone in your family has NF2, you have a higher risk of getting a vestibular schwannoma. &nbsp;",
"       </li>",
"       <li>",
"        People who spend a lot of time around loud noise &ndash; This can happen at work or from loud music.",
"       </li>",
"       <li>",
"        People who had head and neck radiation treatment in childhood &ndash; This can cause a vestibular schwannoma many years later.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H27200537\">",
"      <span class=\"h1\">",
"       What are the symptoms of a vestibular schwannoma?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Hearing loss &ndash; This can happen over many years. A person might not realize he or she does not hear as well as before. &nbsp;",
"       </li>",
"       <li>",
"        Tinnitus &ndash; This is when a person has ringing, buzzing, hissing, or roaring sounds in 1 or both ears.",
"       </li>",
"       <li>",
"        Balance problems when walking",
"       </li>",
"       <li>",
"        A feeling of tilting to 1 side",
"       </li>",
"       <li>",
"        Face symptoms &ndash; These can include:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Numbness",
"       </li>",
"       <li>",
"        Pain",
"       </li>",
"       <li>",
"        Trouble moving part of the face",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H27200552\">",
"      <span class=\"h1\">",
"       Is there a test for vestibular schwannoma?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. The doctor or nurse will do an exam and learn about your symptoms. He or she can order the following tests:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        A test called an &ldquo;audiogram&rdquo; &ndash; In this test, you put on a headset. A hearing specialist (called an &ldquo;audiologist&rdquo;) plays sounds in 1 ear at a time. He or she asks you to signal when you hear the sounds. The test shows if you have hearing loss that could be from a vestibular schwannoma or another condition. It also shows whether both ears are affected the same way.",
"       </li>",
"       <li>",
"        Imaging tests, such as MRI or CT scans &ndash; These tests create pictures of the inside of the body. They can show a vestibular schwannoma or other growth that is causing symptoms.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H27200567\">",
"      <span class=\"h1\">",
"       How is a vestibular schwannoma treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatments include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Surgery &ndash; Taking out the vestibular schwannoma can help you keep the hearing you still have. But if you already lost some hearing, surgery will not usually bring it back. &nbsp;",
"       </li>",
"       <li>",
"        Radiation &ndash; This treatment uses high doses of X-rays to keep the vestibular schwannoma from growing and causing more symptoms.",
"       </li>",
"       <li>",
"        Watchful waiting &ndash; This means you wait to see if your symptoms change, but don't have treatment right away. You get an imaging test every year. You will probably also have regular hearing tests. You might have surgery or radiation if the vestibular schwannoma starts growing quickly.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Doctors might recommend surgery or radiation if:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        You are younger than many people with vestibular schwannoma.",
"       </li>",
"       <li>",
"        You have a large vestibular schwannoma.",
"       </li>",
"       <li>",
"        You have a lot of hearing loss because of the vestibular schwannoma &ndash; Without treatment, you could lose all your hearing. This is more likely if the vestibular schwannoma grows quickly.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Doctors might recommend watchful waiting if:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        You are older.",
"       </li>",
"       <li>",
"        You have a small vestibular schwannoma.",
"       </li>",
"       <li>",
"        You have not lost much hearing yet.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      A vestibular schwannoma can come back after surgery or radiation. If you have either of these treatments, you will probably have an MRI or CT every year for up to 10 years. These imaging tests can show if the vestibular schwannoma is coming back.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H27200582\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?32/26/33186?source=see_link\">",
