" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Epidemiology of coronary heart disease",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?43/20/44361/contributors\">",
