var title_f43_20_44362="Hamman Rich Low";
var content_f43_20_44362=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F63702%7EPULM%2F53033%7EPULM%2F77085&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F63702%7EPULM%2F53033%7EPULM%2F77085&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Acute interstitial pneumonia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 284px; height: 186px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Low power photomicrograph shows dramatic interstitial thickening in a patient with acute interstitial pneumonia (Hamman-Rich disease). The prominent air spaces represent alveolar ducts while the intervening lung shows collapsed alveolar septa distorted by proliferating fibroblasts and myofibroblasts.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Jeffrey L Myers, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal lung",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 240px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Low power photomicrograph of normal lung tissue shows open alveoli with thin, capillary- containing interstitial spaces. An artery (A) is identifiable by its thick, muscular wall; the accompanying bronchus (B) contains mucoid material and is lined by columnar respiratory epithelial cells.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Steven E Weinberger, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Acute interstitial pneumonia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 288px; height: 189px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    High power photomicrograph of acute interstitial pneumonia (Hamman-Rich disease) shows marked alveolar septal thickening resulting from proliferating spindle cells. There is only a minor infiltrate of mononuclear inflammatory cells. The thickened alveolar septa are lined by hyperplastic pneumocytes.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Jeffrey L Myers, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal lung",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 330px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    High power photomicrograph shows alveoli containing capillaries within a narrow interstitium. The alveoli are lined with thin, elongated type I pneumoctes (red arrow) and smaller numbers of cuboidal type II pneumocytes (green arrow).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Steven E Weinberger, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Reparative phase of diffuse alveolar damage",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 358px; height: 232px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Distribution of matrix-containing active fibroblasts (staining brown for procollagen type I and purple for procollagen type IV) follows alveolar ducts in acute diffuse alveolar damage in a distribution similar to that of hyaline membranes.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     From Kuhn, C, III. Chest 1991; 99:11S.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal lung",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 330px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    High power photomicrograph shows alveoli containing capillaries within a narrow interstitium. The alveoli are lined with thin, elongated type I pneumoctes (red arrow) and smaller numbers of cuboidal type II pneumocytes (green arrow).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Steven E Weinberger, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
