var title_f43_20_44363="Need for liver TPL in PBC";
var content_f43_20_44363=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F65783&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F65783&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Mayo scoring system for predicting the need for liver transplantation in primary biliary cirrhosis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        R = [0.871 x log",
"        <sub>",
"         e",
"        </sub>",
"        serum bilirubin (mg/dL)] - [2.53 x log",
"        <sub>",
"         e",
"        </sub>",
"        serum albumin (gm/dL)]",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        + [0.039 x age (years)] + [2.38 x log",
"        <sub>",
"         e",
"        </sub>",
"        prothrombin time (seconds)]",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        + [0.859 x edema score]",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Edema score",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        0 = no edema",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        0.5 = diuretic-controlled edema",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1.0 = diuretic-resisitant edema",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Survival function [S(t)]",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1 year = 0.970",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2 years = 0.941",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3 years = 0.883",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4 years = 0.774",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        5 years = 0.721",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        6 years = 0.651",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Calculated patient survival = S(t)",
"        <sup>",
"         exp(R - 5.07)",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Survival probability at one year = 0.970",
"        <sup>",
"         exp(R - 5.07)",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Survival probability at three years = 0.883",
"        <sup>",
"         exp(R - 5.07)",
"        </sup>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from Dickson, ER, Grambsch, PM, Fleming, TR, et al, Hepatology 1989; 10:1, and Grambsch, PM, Dickson, ER, Kaplan, M, et al, Hepatology 1989; 10:846.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f43_20_44363=[""].join("\n");
var outline_f43_20_44363=null;
var title_f43_20_44364="Diagnosis of COPD I";
var content_f43_20_44364=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F53303&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F53303&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Diagnosis of chronic obstructive pulmonary disease",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        History",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Risk factors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Family history",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3_start\">",
"        Smoking history",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3\">",
"        Age at initiation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3\">",
"        Average amount smoked per day since initiation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3\">",
"        Date when stopped smoking or a current smoker",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3_start\">",
"        Environmental history",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3\">",
"        The chronologically taken environmental history may disclose important risk factors for COPD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Asthma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Symptoms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_single\">",
"        Dyspnea",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Ask about the amount of effort required to induce uncomfortable breathing. Many individuals will deny symptoms of dyspnea, but will have reduced their activity levels substantially.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_single\">",
"        Cough",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Cough with or without sputum production should be an indication for spirometric testing. The presence of chronic cough and sputum has been used to define chronic bronchitis.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_single\">",
"        Wheezing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Wheezing or squeaky noises occurring during breathing indicate the presence of airflow obstruction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_single\">",
"        Acute chest illnesses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Inquire about occurrence and frequency of episodes of increased cough and sputum with wheezing, dyspnea, or fever",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Physical examination",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        All physical findings are generally present only with severe disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Chest",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        The presence of emphysema (only when severe) is indicated by: overdistention of the lungs in the stable state (chest held near full inspiratory position at end of normal expiration, low diaphragmatic position), decreased intensity of breath and heart sounds, and prolonged expiratory phase",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Evidence of airflow obstruction: wheezes during auscultation on slow or forced breathing and prolongation of forced expiratory time",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Frequently observed with severe disease (characteristic, but not diagnostic): pursed-lip breathing, use of accessory respiratory muscles, retraction of lower interspaces",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Other",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Unusual positions to relieve dyspnea at rest",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Digital clubbing is NOT typical in COPD (even with associated hypoxemia) and suggests other diagnoses (eg, lung cancer, bronchiectasis, pulmonary fibrosis)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Mild dependent edema may be seen in the absence of right heart failure",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f43_20_44364=[""].join("\n");
var outline_f43_20_44364=null;
var title_f43_20_44365="Spider entomology";
var content_f43_20_44365=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F59049&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F59049&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Medically relevant spiders by geographic location",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Geographical location",
"       </td>",
"       <td class=\"subtitle1\">",
"        Common name and species",
"       </td>",
"       <td class=\"subtitle1\">",
"        Appearance",
"       </td>",
"       <td class=\"subtitle1\">",
"        Typical habitat",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Widows",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Southeastern United States (Maryland, Southern Ohio and lower states)",
"       </td>",
"       <td>",
"        <p>",
"         Southern black widow",
"        </p>",
"        <p>",
"         <em>",
"          L. mactans",
"         </em>",
"        </p>",
"       </td>",
"       <td rowspan=\"2\">",
"        Shiny black spider with some form of red on body",
"       </td>",
"       <td rowspan=\"6\">",
"        <p>",
"         Clutter surrounding homes (eg, gardens, sheds, garages)",
"        </p>",
"        <p>",
"         Rarely indoors",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Western half of the United States from Canada to Mexico",
"       </td>",
"       <td>",
"        <p>",
"         Western black widow",
"        </p>",
"        <p>",
"         <em>",
"          L. hesperus",
"         </em>",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         New Zealand (coastal areas)",
"        </p>",
"        <p>",
"         Australia (coastal areas)",
"        </p>",
"        <p>",
"         Japan (Osaka prefecture)",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Australian red back",
"        </p>",
"        <p>",
"         <em>",
"          L. hasselti",
"         </em>",
"        </p>",
"       </td>",
"       <td>",
"        Shiny black body with dorsal red stripe",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        South America",
"       </td>",
"       <td>",
"        <em>",
"         L. curacaviensis",
"        </em>",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Mediterranean",
"       </td>",
"       <td>",
"        <p>",
"         Black hag, black wolf",
"        </p>",
"        <p>",
"         <em>",
"          L. tredecimguttatus",
"         </em>",
"        </p>",
"       </td>",
"       <td>",
"        Smattering of 13 red dots on dorsal abdomen,",
"        <strong>",
"         no",
"        </strong>",
"        red hour glass",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        World wide and in United States (from South Carolina to Texas and California)",
"       </td>",
"       <td>",
"        <p>",
"         Brown widow (can bite humans, but envenomation is usually&nbsp;mild)",
"        </p>",
"        <p>",
"         <em>",
"          L. geometricus",
"         </em>",
"        </p>",
"       </td>",
"       <td>",
"        White stripes on a tan abdomen with&nbsp;orange hourglass, abdomen color can vary from cream to almost black",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        False Black Widows",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         United States: Pacific coast and Colorado",
"        </p>",
"        <p>",
"         Canada: British Columbia",
"        </p>",
"        <p>",
"         Australia",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         False black widow",
"        </p>",
"        <p>",
"         <em>",
"          S. grossa",
"         </em>",
"        </p>",
"       </td>",
"       <td rowspan=\"2\">",
"        <p>",
"         Similar shape to widows",
"        </p>",
"        <p>",
"         Chocolate brown color with tan stripes or markings on abdomen",
"        </p>",
"        <p>",
"         <strong>",
"          do not",
"         </strong>",
"         &nbsp;have red markings",
"        </p>",
"       </td>",
"       <td rowspan=\"2\">",
"        <p>",
"         Clutter surrounding homes",
"        </p>",
"        <p>",
"         Also indoors (in cupboards and undisturbed places)",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Europe",
"       </td>",
"       <td>",
"        <p>",
"         <em>",
"          S. paykulliana",
"         </em>",
"        </p>",
"        <p>",
"         <em>",
"          S. grossa",
"         </em>",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Recluses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        United States: Mid-west and Southern states extending westward (see map in text)",
"       </td>",
"       <td>",
"        <p>",
"         Brown recluse",
"        </p>",
"        <p>",
"         <em>",
"          L. reclusa",
"         </em>",
"        </p>",
"       </td>",
"       <td rowspan=\"4\">",
"        <p>",
"         Non-descript brown spiders",
"        </p>",
"        <p>",
"         Recluses have 3 pairs of eyes (6 total), monochromatic abdomen and legs, and very fine hairs on legs",
"        </p>",
"       </td>",
"       <td rowspan=\"4\">",
"        <p>",
"         Mostly inside homes: attics, basements, cupboards",
"        </p>",
"        <p>",
"         Outdoors: in rock piles and under tree bark,",
"         <strong>",
"          not",
"         </strong>",
"         &nbsp;in live vegetation",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Worldwide infestations of buildings",
"       </td>",
"       <td>",
"        <p>",
"         Mediterranean recluse",
"        </p>",
"        <p>",
"         <em>",
"          L. rufescens",
"         </em>",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        South America (Brazil, Chile, others)",
"       </td>",
"       <td rowspan=\"2\">",
"        <p>",
"         Chilean recluse",
"        </p>",
"        <p>",
"         <em>",
"          L. laeta",
"         </em>",
"        </p>",
"        <p>",
"         <em>",
"          L. intermedia",
"         </em>",
"        </p>",
"        <p>",
"         <em>",
"          L. gaucho",
"         </em>",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Isolated reports in South Africa, Australia",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Phoneutria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        South America",
"       </td>",
"       <td>",
"        <p>",
"         Brazilian wandering spider",
"        </p>",
"        <p>",
"         <em>",
"          P. nigriventer",
"         </em>",
"        </p>",
"        <p>",
"         <em>",
"          P. keyserlingi",
"         </em>",
"        </p>",
"        <p>",
"         <em>",
"          P. fera",
"         </em>",
"        </p>",
"       </td>",
"       <td>",
"        Large, extensively-haired spider (up to 95 mm legspan)",
"       </td>",
"       <td>",
"        <p>",
"         Forage at night and may enter homes to take refuge under household items during the day.",
"        </p>",
"        <p>",
"         Found in urban environments in piles of clutter, vegetation, or rubbish.",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Australian Funnel Web",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Australia - Southeastern coastal regions (including Sydney and Brisbane)",
"       </td>",
"       <td>",
"        <p>",
"         Australian funnel web spider",
"        </p>",
"        <p>",
"         <em>",
"          Atrax robustus",
"         </em>",
"        </p>",
"        <p>",
"         5 species of",
"         <em>",
"          Hadronyche",
"         </em>",
"        </p>",
"       </td>",
"       <td>",
"        Large spider (25 mm body length), shiny black coloration on body",
"       </td>",
"       <td>",
"        Moist areas such as basements",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
